CREATE TABLE sales (
    genre                VARCHAR      NOT NULL,
    platform             VARCHAR      NOT NULL,
    manufacturer         VARCHAR      NOT NULL,
    manufacturer_year    INTEGER      NOT NULL,
    headquarter_city     VARCHAR      NOT NULL,
    headquarter_country  VARCHAR      NOT NULL,
    ceo                  VARCHAR      NOT NULL,
    decade               INTEGER      NOT NULL,
    sales                DECIMAL(4,2) NOT NULL,
    rank                 INTEGER      NOT NULL,
    PRIMARY KEY (genre, platform, decade)
);

