-- Snowflake Schema (3. NF)
CREATE TABLE sf_genre (
    genre_id  INTEGER PRIMARY KEY,
    genre     VARCHAR NOT NULL
);

INSERT INTO sf_genre
SELECT ROW_NUMBER(ORDER BY genre) OVER(), *
FROM (
    SELECT DISTINCT genre FROM sales
);

CREATE TABLE sf_countries (
    country_id  INTEGER PRIMARY KEY,
    country     VARCHAR NOT NULL
);

INSERT INTO sf_countries
SELECT ROW_NUMBER(ORDER BY headquarter_country) OVER(), *
FROM (
    SELECT DISTINCT headquarter_country FROM sales
);

CREATE TABLE sf_cities (
    city_id     INTEGER PRIMARY KEY,
    city        VARCHAR NOT NULL,
    country_id  INTEGER NOT NULL,
    FOREIGN KEY (country_id) REFERENCES sf_countries(country_id)
);

INSERT INTO sf_cities
SELECT
    ROW_NUMBER(ORDER BY headquarter_city) OVER(),
    headquarter_city,
    (SELECT country_id FROM sf_countries WHERE country = headquarter_country)
FROM (
    SELECT DISTINCT headquarter_city, headquarter_country FROM sales
);

CREATE TABLE sf_ceos (
    ceo_id  INTEGER PRIMARY KEY,
    ceo     VARCHAR NOT NULL
);

INSERT INTO sf_ceos
SELECT ROW_NUMBER(ORDER BY ceo) OVER(), *
FROM (
    SELECT DISTINCT ceo FROM sales
);

CREATE TABLE sf_manufacturers (
    manufacturer_id  INTEGER PRIMARY KEY,
    manufacturer     VARCHAR NOT NULL,
    year             INTEGER NOT NULL,
    city_id          INTEGER NOT NULL,
    ceo_id           INTEGER NOT NULL,
    FOREIGN KEY (city_id) REFERENCES sf_cities(city_id),
    FOREIGN KEY (ceo_id) REFERENCES sf_ceos(ceo_id)
);

INSERT INTO sf_manufacturers
SELECT
    ROW_NUMBER(ORDER BY manufacturer_year) OVER(),
    manufacturer,
    manufacturer_year,
    (SELECT city_id FROM sf_cities WHERE city = headquarter_city),
    (SELECT ceo_id FROM sf_ceos WHERE ceo = cn)
FROM (
    SELECT DISTINCT manufacturer, manufacturer_year, headquarter_city, ceo AS cn FROM sales
);

CREATE TABLE sf_platforms (
    platform_id     INTEGER PRIMARY KEY,
    platform        VARCHAR NOT NULL,
    manufacturer_id INTEGER NOT NULL,
    FOREIGN KEY (manufacturer_id) REFERENCES sf_manufacturers(manufacturer_id)
);

INSERT INTO sf_platforms
SELECT
    ROW_NUMBER(ORDER BY mn) OVER(),
    platform,
    (SELECT manufacturer_id FROM sf_manufacturers WHERE manufacturer = mn)
FROM (
    SELECT DISTINCT platform, manufacturer AS mn FROM sales
);

CREATE TABLE sf_decades (
    decade_id  INTEGER PRIMARY KEY,
    decade     INTEGER
);

INSERT INTO sf_decades
SELECT
    ROW_NUMBER() OVER(ORDER BY decade),
    decade
FROM (
    SELECT DISTINCT decade FROM sales
);

CREATE TABLE sf_sales (
    genre_id         INTEGER       NOT NULL,
    platform_id      INTEGER       NOT NULL,
    decade_id        INTEGER       NOT NULL,
    sales            DECIMAL(4, 2) NOT NULL,
    rank             INTEGER       NOT NULL,
    PRIMARY KEY (genre_id, platform_id, decade_id),
    FOREIGN KEY (genre_id)    REFERENCES sf_genre(genre_id),
    FOREIGN KEY (platform_id) REFERENCES sf_platforms(platform_id),
    FOREIGN KEY (decade_id)   REFERENCES sf_decades(decade_id)
);

INSERT INTO sf_sales
SELECT
    (SELECT genre_id FROM sf_genre WHERE genre = sales.genre),
    (SELECT platform_id FROM sf_platforms WHERE platform = sales.platform),
    (SELECT decade_id FROM sf_decades WHERE decade = sales.decade),
    sales,
    rank
FROM sales;


-- Star Schema (1. NF)
CREATE TABLE st_genre (
    genre_id  INTEGER PRIMARY KEY,
    genre     VARCHAR NOT NULL
);

INSERT INTO st_genre
SELECT ROW_NUMBER(ORDER BY genre) OVER(), *
FROM (
    SELECT DISTINCT genre FROM sales
);

CREATE TABLE st_platforms (
    platform_id          INTEGER PRIMARY KEY,
    platform             VARCHAR NOT NULL,
    manufacturer         VARCHAR NOT NULL,
    manufacturer_year    INTEGER NOT NULL,
    headquarter_city     VARCHAR NOT NULL,
    headquarter_country  VARCHAR NOT NULL,
    ceo                  VARCHAR NOT NULL
);

INSERT INTO st_platforms
SELECT ROW_NUMBER(ORDER BY platform) OVER(), *
FROM (
    SELECT DISTINCT platform, manufacturer, manufacturer_year, headquarter_city, headquarter_country, ceo FROM sales
);

CREATE TABLE st_decades (
    decade_id  INTEGER PRIMARY KEY,
    decade     INTEGER
);

INSERT INTO st_decades
SELECT
    ROW_NUMBER() OVER(ORDER BY decade),
    decade
FROM (
    SELECT DISTINCT decade FROM sales
);

CREATE TABLE st_sales (
    genre_id     INTEGER       NOT NULL,
    platform_id  INTEGER       NOT NULL,
    decade_id    INTEGER       NOT NULL,
    sales        DECIMAL(4, 2) NOT NULL,
    rank         INTEGER       NOT NULL,
    PRIMARY KEY (genre_id, platform_id, decade_id),
    FOREIGN KEY (genre_id) REFERENCES st_genre(genre_id),
    FOREIGN KEY (platform_id) REFERENCES st_platforms(platform_id),
    FOREIGN KEY (decade_id) REFERENCES st_decades(decade_id)
);

INSERT INTO st_sales
SELECT
    (SELECT genre_id FROM st_genre WHERE genre = sales.genre),
    (SELECT platform_id FROM st_platforms WHERE platform = sales.platform),
    (SELECT decade_id FROM st_decades WHERE decade = sales.decade),
    sales,
    rank
FROM sales;
